cmd({
        pattern: "broadcast",
        alias: ["bc"],
        desc: "Bot makes a broadcast in all groups",
        fromMe: true,
        category: "group",
        filename: __filename,
        use: '<text for broadcast.>',
    },
    async(Void, citel, text, {isCreator}) => {
        if (!isCreator) return citel.reply(tlang().owner)
        let getGroups = await Void.groupFetchAllParticipating();
        let groups = Object.entries(getGroups)
            .slice(0)
            .map((entry) => entry[1]);
        let anu = groups.map((v) => v.id);
        citel.reply(`sᴇɴᴅ ʙʀᴏᴀᴅᴄᴀsᴛ ᴛᴏ ${anu.length} ɢʀᴏᴜᴘ ᴄʜᴀᴛ, ꜰɪɴɪsʜ ᴛɪᴍᴇ ${
          anu.length * 1.5
        } sᴇᴄᴏɴᴅs`);
        for (let i of anu) {
            await sleep(1500);
            let txt = `*--${tlang().title} ʙʀᴏᴀᴅᴄᴀsᴛ--*\n\n *ᴀᴜᴛʜᴏʀ:* ᴍᴀʜᴇʀ ᴢᴜʙᴀɪʀ\n\n${text}`;
            let buttonMessaged = {
                image: log0,
                caption: txt,
                footer: citel.pushName,
                headerType: 1,
                contextInfo: {
                    forwardingScore: 999,
                    isForwarded: false,
                    externalAdReply: {
                        title: 'ʙʀᴏᴀᴅᴄᴀsᴛ ʙʏ ' + citel.pushName,
                        body: tlang().title,
                        thumbnail: log0,
                        mediaUrl: '',
                        mediaType: 2,
                        sourceUrl: gurl,
                        showAdAttribution: true,
                    },
                },
            };
            await Void.sendMessage(i, buttonMessaged, {
                quoted: citel,
            });
        }
        citel.reply(`*sᴜᴄᴄᴇssғᴜʟ sᴇɴᴅɪɴɢ ʙʀᴏᴀᴅᴄᴀsᴛ ᴛᴏ ${anu.length} ɢʀᴏᴜᴘ(s)*`);
    }
)

